import { alpha, styled } from '@mui/material/styles';
import InputBase from '@mui/material/InputBase';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import CardContent from '@mui/material/CardContent';
import Card from '@mui/material/Card';
import ProjectDetails from './ProjectDetails.css';
import React, { useState, useEffect } from "react";
import axios from "axios";
import "./ProjectDetails.css";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import SearchIcon from '@mui/icons-material/Search';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import Select from '@mui/material/Select';
import NativeSelect from '@mui/material/NativeSelect';

export default function CustomizedInputsStyled() {

const BootstrapInput = styled(InputBase)(({ theme }) => ({
  'label + &': {
    marginTop: theme.spacing(2.5),
  },
  '& .MuiInputBase-input': {
    borderRadius: 4,
    position: 'relative',
    border: '1px solid',
    borderColor: theme.palette.mode === 'light' ? '#B4B4B4' : '#2D3843',
    fontSize: 16,
    width: '480px',
    padding: '10px 12px',
    transition: theme.transitions.create([
      'border-color',
      'background-color',
      'box-shadow',
    ]),
    fontFamily: [
      'Roboto',
    ].join(','),
    fontStyle: "normal",
    fontWeight: 500,
    fontSize: '11px',
    lineHeight: '16px',
  },
}));

let data = [

];

const [newSearchedRows, setNewSearchedRows] = useState(data);

const handleFilterStatus = (event) => {
console.log(event);
let prop=event.target.value;
if(prop===""){
setNewSearchedRows(data);
}
else{
const filteredRows = data.filter((row) => {
  console.log(row);
  return row.status.includes(prop);
});
console.log(filteredRows);
setNewSearchedRows(filteredRows);
}
}
    
  return (
    <Card style={{
        width: 1100,
        height: 500,
        marginTop: 50,
        marginLeft: 50.
    }}>
      <CardContent>
    <Box
      component="form"
      noValidate
      sx={{
        display: 'grid',
        gridTemplateColumns: { sm: '1fr 1fr' },
        gap: 2,
      }}
    >
      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Title
        </InputLabel>
        <BootstrapInput defaultValue="Title of your project" id="bootstrap-input" />
      </FormControl>

      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Category
        </InputLabel>
        {/* <BootstrapInput defaultValue="Select category of the project" id="bootstrap-input" /> */}
        <Select
                  className="filter"
                    labelId="bootstrap-input-label"
                    id="bootstrap-input"
                    defaultValue="Select category of the project"
                    onChange={handleFilterStatus}
                  >
                    <MenuItem value={"All"}>All</MenuItem>
                    <MenuItem value={"completed"}>completed</MenuItem>
                    <MenuItem value={"Not Completed"}>Not Completed</MenuItem>
                  </Select>
      </FormControl>

    </Box>
    <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Project Scope
        </InputLabel>
        <BootstrapInput defaultValue="Provide a detail description of your project" id="bootstrap-input" width="800px !important" />
      </FormControl>

      <br></br>

      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Requirements
        </InputLabel>
        <BootstrapInput defaultValue="Describe Requirement of Project" id="bootstrap-input" />
      </FormControl>

    <Box
      component="form"
      noValidate
      sx={{
        display: 'grid',
        gridTemplateColumns: { sm: '1fr 1fr' },
        gap: 2,
      }}
    >
      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Duration
        </InputLabel>
        <BootstrapInput defaultValue="Time required to finish the project" id="bootstrap-input" />
      </FormControl>

      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Technology/Tools
        </InputLabel>
        <BootstrapInput defaultValue="Technology/ Tool need to be used in this project" id="bootstrap-input" />
      </FormControl>

    </Box>

    <Box
      component="form"
      noValidate
      sx={{
        display: 'grid',
        gridTemplateColumns: { sm: '1fr 1fr' },
        gap: 2,
      }}
    >
      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Deliverable
        </InputLabel>
        <BootstrapInput defaultValue="Describe deliverables" id="bootstrap-input" />
      </FormControl>

      <FormControl variant="standard">
        <InputLabel shrink htmlFor="bootstrap-input">
          Tags
        </InputLabel>
        <BootstrapInput defaultValue="Add relevant tags to help others find your project" id="bootstrap-input" />
      </FormControl>

    </Box>    
    </CardContent>
    </Card>
  );
}
